import React from "react";
import "./style.css";
import { Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import Contact from "./components/Contact";
import Task from "./components/Task";

const App = () => {
  const [formData, setFormData] = useState(null);

  const saveData = (data) => {
    // Save the form data in local storage or perform any desired action
    setFormData(data);
  };

  const clearLocalStorage = () => {
    // Clear the data stored in local storage or perform any desired action
    setFormData(null);
  };

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/task" element={<Task />} />

      </Routes>
      <Home clearLocalStorage={clearLocalStorage} />
      <ContactPage saveData={saveData} />
    </div>
  );
}
export default App;
